const Navbar = () => {
  return <div>
    <nav>
      <div></div>
      <div>
        <div>Home</div>
        <div><img src='../../public/android-chrome-192x192.png' alt="Cart" width={120} height={120}/></div>
      </div>
    </nav>
  </div>;
};

export default Navbar;
